### Description
allow creating (u)int64 tensors from either a number array or a bigint array.

before:

```js
// TypeScript think is good, but actually does not work
// runtime error: Uncaught TypeError: Cannot convert 1 to a BigInt
const myTensor1 = new Tensor('int64', [1, 2, 3, 4], [2, 2]);

// runtime good, but TypeScript thinks myTensor2 is a string tensor
const myTensor2 = new Tensor('int64', [1n, 2n, 3n, 4n], [2, 2]);
```

after:
```js
// both work at runtime and TypeScript populates the correct types
const myTensor1 = new Tensor('int64', [1, 2, 3, 4], [2, 2]);
const myTensor2 = new Tensor('int64', [1n, 2n, 3n, 4n], [2, 2]);
```

### Describe the issue

使用onnxruntime1.11.0部署了Unet模型。
在使用c++多线程时会在session.run()的位置报错。
而且报错的时机是随机的，有时不报错有时报错。
所有变量都是本地声明的，应该也不会产生冲突。

### To reproduce

```
//model
    wchar_t* model_path = this->set_model_path(index);

    Ort::Env env(ORT_LOGGING_LEVEL_WARNING, "ONNXExample"); // ONNX Runtime enviroment

    //ONNX環境を設置する
    //ONNXの様々なオプションを設置する（ここではORT_ENABLE_ALLで全部のOptimizerを使う）
    Ort::SessionOptions session_options;
    session_options.SetGraphOptimizationLevel(GraphOptimizationLevel::ORT_ENABLE_ALL);
    //ONNXモデルを読み込む
    //onnx net session
    Ort::Session session{ nullptr };
    session = Ort::Session(env, model_path, session_options);

	//preprocess: BGR -> RGB -> Tensor
    std::vector<Ort::Value> input_tensors = this->preprocess(src);

    //モデルのinput layerをprintする
    Ort::AllocatorWithDefaultOptions allocator;

    ////inputとoutput数量を計算する
    size_t num_input_nodes = session.GetInputCount();
    size_t num_output_nodes = session.GetOutputCount();

    ////inputとoutput name を出力する
    const char* input_name = session.GetInputName(0, allocator);
    //std::cout << "input name: " << input_name << std::endl;
    const char* output_name = session.GetOutputName(0, allocator);
    //std::cout << "output name: " << output_name << std::endl;

    ////モデルの情報を出力する
    auto input_dims = session.GetInputTypeInfo(0).GetTensorTypeAndShapeInfo().GetShape();
    auto output_dims = session.GetOutputTypeInfo(0).GetTensorTypeAndShapeInfo().GetShape();
    //std::cout << "input dims: " << input_dims[0] << input_dims[1] << input_dims[2] << input_dims[3] << std::endl;
    //std::cout << "output dims: " << output_dims[0] << output_dims[1] << output_dims[2] << output_dims[3] << std::endl;
    std::vector<const char*> input_names{ input_name };
    std::vector<const char*> output_names{ output_name };
    std::vector<const char*> input_node_names = { "input" };
    std::vector<const char*> output_node_names = { "output" };

    //infrence
    auto output_tensors = session.Run(Ort::RunOptions{ nullptr }, input_node_names.data(), input_tensors.data(), input_tensors.size(), output_node_names.data(), output_node_names.size());
    assert(output_tensors.size() == 1 && output_tensors.front().IsTensor());

    // Get mask
    std::vector<int64_t> pos;
    cv::Mat newarr = cv::Mat::zeros(170, 170, CV_32FC1);
    //cv::Mat inputarr = cv::Mat::zeros(170, 170, CV_32FC3);
    for (int ii = 0; ii < newarr.rows; ii++)
    {
        for (int jj = 0; jj < newarr.cols; jj++)
        {
            pos = std::vector<int64_t>{ 0, 0, ii, jj };
            newarr.at<float>(ii, jj) = output_tensors[0].At<float>(pos) * 255.0;

        }
    }

    cv::Mat newarr_uchar;
    newarr.convertTo(newarr_uchar, CV_8UC1, 255.0);

    cv::Mat newarr_uchar_resized;
    cv::resize(newarr_uchar, newarr_uchar_resized, src.size());
